import React from 'react';
import { useState } from 'react';

import data from './levels.json'
import Tracks from './Tracks'
import ChronoTime from './ChronoTime';


function App() {

  const [lap, setLap] = useState(65123);

  return (
    <div>
      <h1>F1 2022 Difficulty Helper</h1>
      <div>
          <ChronoTime 
            value={lap} 
            onChange={(t) => setLap(t)} />
          <Tracks 
            data={data}
            time={lap} />
      </div>
    </div>
  );
}

export default App;
